%script
/*  Clean out old table  */

BEGIN
      EXECUTE IMMEDIATE 'DROP Table BM_CLEANED';
  EXCEPTION
      WHEN OTHERS THEN NULL;
END;
/

/*  Create a new table with cleaned data */

CREATE Table BM_CLEANED 
  AS (SELECT AGE, MARITAL, DEFAULTER, BALANCE, LOAN, HOUSING, (CASE WHEN Y = 'yes' THEN 1 ELSE 0 END) Y , row_id
      FROM BANK_DEFAULTER_DATA);

%script
/* Build a classification model and then generate a lift test result and an apply result.  */

DECLARE
v_sql varchar2(100);

BEGIN

/*  drop build settings  */
BEGIN
v_sql := 'DROP TABLE bm_model_settings PURGE';
EXECUTE IMMEDIATE v_sql;
DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
WHEN OTHERS THEN
DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;

/*  drop model  */
BEGIN
v_sql := 'CALL DBMS_DATA_MINING.DROP_MODEL(''bm_model'')';
EXECUTE IMMEDIATE v_sql;
DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
WHEN OTHERS THEN
DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no model exists');
END;

/*  drop apply result  */
BEGIN
v_sql := 'DROP TABLE bm_result PURGE';
EXECUTE IMMEDIATE v_sql;
DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
WHEN OTHERS THEN
DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;

/*  drop lift result  */
BEGIN
v_sql := 'DROP TABLE bm_lift PURGE';
EXECUTE IMMEDIATE v_sql;
DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
WHEN OTHERS THEN
DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;


/*  Split the Data into train and test  */

EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW bm_train AS SELECT * FROM bm_cleaned SAMPLE (80) SEED (1)';
DBMS_OUTPUT.PUT_LINE ('Created bm_train');
EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW bm_test AS SELECT * FROM bm_cleaned MINUS SELECT * FROM bm_train';
DBMS_OUTPUT.PUT_LINE ('Created bm_test');

/*  Create a Build Setting (DT) for Model Build  */

EXECUTE IMMEDIATE 'CREATE TABLE bm_model_settings (setting_name VARCHAR2(30),setting_value VARCHAR2(4000))';
EXECUTE IMMEDIATE 'INSERT INTO bm_model_settings (setting_name, setting_value) VALUES (''ALGO_NAME'', ''ALGO_DECISION_TREE'')';
EXECUTE IMMEDIATE 'INSERT INTO bm_model_settings (setting_name, setting_value) VALUES (''PREP_AUTO'', ''ON'')';
DBMS_OUTPUT.PUT_LINE ('Created model build settings table: bm_model_settings ');

/*  Build a Classification Model  */

EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.CREATE_MODEL(''bm_model'', ''CLASSIFICATION'', ''bm_train'', ''row_id'',''Y'', ''bm_model_settings'')';
DBMS_OUTPUT.PUT_LINE ('Created model: bm_model');

/*  Test the Model by generating a apply result and then create a lift result  */

EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.APPLY(''bm_model'',''bm_test'',''row_id'',''bm_result'')';
DBMS_OUTPUT.PUT_LINE ('Created apply result: bm_result ');
EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.COMPUTE_LIFT(''bm_result'',''bm_test'',''row_id'',''y'',''bm_lift'',''1'',''PREDICTION'',''PROBABILITY'',100)';
DBMS_OUTPUT.PUT_LINE ('Created lift result: bm_lift ');

END;

%script
DECLARE
v_sql varchar2(100);
   /*  drop confusion matrix result  */
BEGIN
v_sql := 'DROP TABLE bm_confusion_matrix PURGE';
EXECUTE IMMEDIATE v_sql;
 DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
    EXCEPTION
    WHEN OTHERS THEN
 DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;
/
DECLARE
   m_accuracy    NUMBER;
BEGIN

 DBMS_DATA_MINING.COMPUTE_CONFUSION_MATRIX (
   accuracy                     => m_accuracy,
   apply_result_table_name      => 'bm_result',
   target_table_name            => 'bm_test',
   case_id_column_name          => 'row_id',
   target_column_name           => 'Y',
   confusion_matrix_table_name  => 'bm_confusion_matrix',
   score_column_name            => 'PREDICTION',
   score_criterion_column_name  => 'PROBABILITY',
   cost_matrix_table_name       =>  null,
   apply_result_schema_name     =>  null,
   target_schema_name           =>  null,
   cost_matrix_schema_name      =>  null);
 DBMS_OUTPUT.PUT_LINE('Accuracy of the model: ' || m_accuracy);
END;

%sql
/*  How likely a client can the client subscribe a term deposit? if his age is 36, education is secondary and has a housing loan */


Select prediction_probability(bm_model, '1'
  USING '36' as AGE, 'secondary' as EDUCATION, 'yes' as HOUSING)
from dual;
